import { Link, useParams } from "react-router-dom"

const SingleDog = () => {
    const [dog, setDog] = useState([null]);
    const {name} = useParams();
    useEffect(() => {
        fetch(`https://api.thedogapi.com/v1/breeds/search?q=${name}`)
          .then(response => response.json())
          .then(data => {
            setDog(data);
            console.log(data);
          });
      }, []);
    return (
        <>
            <h1>I am {name}</h1>
        </>
    )
}

export default SingleDog;
